import * as React from 'react';
import { useEffect, useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';

import allActions from '../actions';

type RootState = {
  counter: number;
  currentUser: string[];
  entryTeam: string;
};

const Test: React.FC = () => {
  const [team, setTeam] = useState<string>('');
  const counter = useSelector((state: RootState) => state.counter);
  const currentUser = useSelector((state: any) => state.currentUser);
  const entryTeam = useSelector((state: RootState) => state.entryTeam);

  const dispatch = useDispatch();

  const user = { name: 'Rei' };

  const teamName = (event: React.ChangeEvent<HTMLInputElement>) => {
    if (team.length < 33) {
      setTeam(event.target.value);
      console.log(team);
    }
  };

  useEffect(() => {
    dispatch(allActions.userActions.setUser(user.name));
  }, []);

  return (
    <>
      <div>
        {currentUser.loggedIn ? (
          <>
            <h1>Hello, {currentUser.user}</h1>
            <button onClick={() => dispatch(allActions.userActions.logOut())}>Logout</button>
          </>
        ) : (
          <>
            <h1>Login</h1>
            <button onClick={() => dispatch(allActions.userActions.setUser(user.name))}>
              Login as Rei
            </button>
          </>
        )}
        <h1>Counter: {counter}</h1>
        <button onClick={() => dispatch(allActions.counterActions.increment())}>
          Increase Counter
        </button>
        <button onClick={() => dispatch(allActions.counterActions.decrement())}>
          Decrease Counter
        </button>
      </div>
      <div>
        <h1>Entry Test!!!</h1>
        <input onChange={teamName}></input>
        <button onClick={() => dispatch(allActions.entryAction.addItem(team))}>Entry</button>
      </div>
    </>
  );
};

export default Test;
